// src/components/VideoTutorials.js
import React from 'react';
import './VideoTutorials.css';

const VideoTutorials = () => {
  const videos = [
    { title: "Introduction to Accessibility", url: "https://www.youtube.com/embed/pEDl1GPTdzc" },
    { title: "Accessibility Insights", url: "https://www.youtube.com/embed/rPN4IK2wv4U" },
    { title: "Video 3: Interactive Features", url: "https://www.youtube.com/embed/g9Qff0b-lHk" },
    { title: "Video 4: Understanding Accessibility", url: "https://www.youtube.com/embed/gdohlUn7fVQ" },
    { title: "Video 5: Tips for Accessibility", url: "https://www.youtube.com/embed/e2nkq3h1P68" },
    { title: "Video 6: Accessibility in Design", url: "https://www.youtube.com/embed/EbPbwpLRfvQ" },
    { title: "Video 7: Enhancing Accessibility", url: "https://www.youtube.com/embed/3NgFI9rGCys" },
    { title: "Video 8: Accessibility Tools", url: "https://www.youtube.com/embed/iaW8WwIMQdY" },
    { title: "Video 9: Best Practices", url: "https://www.youtube.com/embed/5znQOrGs00U" },
  ];

  return (
    <section>
      <h2>Video Tutorials</h2>
      <div className="video-grid">
        {videos.map((video, index) => (
          <div key={index} className="video-item">
            <h3>{video.title}</h3>
            <iframe
              width="100%"
              height="200"
              src={video.url}
              title={video.title}
              frameBorder="0"
              allowFullScreen
            ></iframe>
          </div>
        ))}
      </div>
    </section>
  );
};

export default VideoTutorials;
